import React from "react";
import NavItems from "./NavBarItem";
const NavBar = (props) => {
  const navBarData = [
    {
      type: "Stays",
      icon: "fa-bed",
      active: true,
    },
    {
      type: "Flights",
      icon: "fa-plane",
      active: false,
    },
    {
      type: "Car rentals",
      icon: "fa-car",
      active: false,
    },
    {
      type: "Attractions",
      icon: "fa-bed",
      active: false,
    },
    {
      type: "Airport taxis",
      icon: "fa-taxi",
      active: false,
    },
  ];

  return (
    <div className="navbar">
      <div className="navContainer">
        <h3>Booking Website</h3>
        <div className="navItems">
          <button className="navButton">Register</button>
          <button className="navButton">login</button>
        </div>
        <NavItems navItem={navBarData} />
      </div>
    </div>
  );
};
export default NavBar;
